;; @@ [cljs]
; macros in clojurescript
; http://blog.klipse.tech/clojure/2016/05/09/macro-tutorial-4.html

(ns my.best$macros)

(defn symbol-several
  "returns a symbol with the concatenation of the str values of the args"
  [& x]
  (symbol (apply str x)))

(defmacro disp [& forms]
  (cons
   `symbol-several
   (for [form forms]
     `(str '~form " => " ~form "\n"))))

(my.best/disp 
